import React from 'react'
import { Work, Wrapper, WorkContainer } from '../Components/MyWork/MyWork.elements'
import { PageTitle } from '../GlobalStyles'
import WorkCard from '../Components/MyWork/WorkCard'
import BlogEmpireImage from '../Images/BlogEmpirestill.png'

function MyWork() {

  return (
    <Work id="MyWork">
      <Wrapper>
        <PageTitle>My Work</PageTitle>
        <WorkContainer>
          <WorkCard 
            image={BlogEmpireImage} 
            title={'Blog Empire'} 
            description={'This is a blog website'} 
            links={{siteUrl: 'https://blogempire.vercel.app', githubLink: 'https://github.com/AeronH/blogempire'}}/>
          {/* <WorkCard 
            image={} 
            title={'AQI-Scan'} 
            description={} 
            links={}/> */}
          

        </WorkContainer>
      </Wrapper>
    </Work>
  )
}

export default MyWork
